  date: Yup.date().required().nullable(),
  wakeUp: Yup.time(),
  nap1: {start: Yup.time(), end: Yup.time() },
  nap2: {start: Yup.time(), end: Yup.time() },
  nap3: {start: Yup.time(), end: Yup.time() },
